Here is an example of how you can sort the keys of a JavaScript object (which is often referred to as a dictionary) alphabetically:

```javascript
let dict = {
    "c": 1,
    "a": 2,
    "e": 3,
    "b": 4,
    "d": 5
};

// Convert the object to an array of key-value pairs
let dictArray = Object.entries(dict);

// Sort the array by the keys (which are strings)
dictArray.sort((a, b) => a[0].localeCompare(b[0]));

// Extract the sorted keys and values back into an object
let sortedDict = {};
for (let pair of dictArray) {
    sortedDict[pair[0]] = pair[1];
}

console.log(sortedDict);
```

When you run this code, it will output:

```javascript
{
    "a": 2,
    "b": 4,
    "c": 1,
    "d": 5,
    "e": 3
}
```

This shows that the keys have been sorted alphabetically.
